import { Grid } from "@material-ui/core";
import { motion } from "framer-motion";
import React, { useEffect, useState } from "react";
import useMethods from "../../../StateProvider/useMethods";
import "./featuredFoodsStyles.css";
const FeaturedFoods = () => {
  const { get_featured_food } = useMethods();
  const [foods, setFoods] = useState([]);
  useEffect(() => {
    const featured_foods = get_featured_food();
    console.log(featured_foods);
  }, []);
  return (
    <motion.div
      whileInView={{ scale: [0, 1], opacity: [0, 1] }}
      transition={{ duration: 1, ease: "easeInOut" }}
      className="featured_food_container"
    >
      <h3>Top Items</h3>
      <>
        {foods.length == 0 ? (
          <p>Loading....</p>
        ) : (
          <Grid container spacing={3}>
            {foods.map((item) => (
              <Grid item xs={10} sm={6} md={4} lg={3}>
                <div className="featured_food_item">
                  <h5>{item.name}</h5>
                </div>
              </Grid>
            ))}
          </Grid>
        )}
      </>
    </motion.div>
  );
};

export default FeaturedFoods;
